"use strict";(self.webpackChunkoverture_documentation=self.webpackChunkoverture_documentation||[]).push([[2199],{99823:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/2024/07/24/explore-site","metadata":{"permalink":"/zh-Hant/blog/2024/07/24/explore-site","source":"@site/i18n/zh-Hant/docusaurus-plugin-content-blog/2024-07-24-explore-site.mdx","title":"\u4e0d\u9700\u8981 SQL \u5c31\u53ef\u4ee5\u63a2\u7d22 Overture \u8cc7\u6599","description":"Overture \u63a8\u51fa\u4e86\u65b0\u7684\u57fa\u65bc\u700f\u89bd\u5668\u7684\u5de5\u5177\uff0c\u70ba\u4f7f\u7528\u8005\u63d0\u4f9b\u4e86\u7121\u9700\u4ee3\u78bc\u5373\u53ef\u8207\u6211\u5011\u8cc7\u6599\u4e92\u52d5\u7684\u9078\u9805\u3002Explore \u7db2\u7ad9\u73fe\u5728\u662f\u958b\u59cb\u4f7f\u7528 Overture \u7684\u6700\u5feb\u9014\u5f91\uff0c\u4e0d\u9700\u8981 SQL\uff1ahttps://explore.overturemaps.org","date":"2024-07-24T00:00:00.000Z","tags":[],"readingTime":3.31,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"\u4e0d\u9700\u8981 SQL \u5c31\u53ef\u4ee5\u63a2\u7d22 Overture \u8cc7\u6599"},"unlisted":false,"nextItem":{"title":"\u571f\u5730\u690d\u88ab\u72c0\u6cc1\u5373\u6642\u66f4\u65b0","permalink":"/zh-Hant/blog/2024/05/16/land-cover"}},"content":"Overture \u63a8\u51fa\u4e86\u65b0\u7684\u57fa\u65bc\u700f\u89bd\u5668\u7684\u5de5\u5177\uff0c\u70ba\u4f7f\u7528\u8005\u63d0\u4f9b\u4e86\u7121\u9700\u4ee3\u78bc\u5373\u53ef\u8207\u6211\u5011\u8cc7\u6599\u4e92\u52d5\u7684\u9078\u9805\u3002Explore \u7db2\u7ad9\u73fe\u5728\u662f\u958b\u59cb\u4f7f\u7528 Overture \u7684\u6700\u5feb\u9014\u5f91\uff0c\u4e0d\u9700\u8981 SQL\uff1a[https://explore.overturemaps.org](https://explore.overturemaps.org/#13.01/39.95692/-75.15583)\\r\\n\\r\\n| ![\u63a2\u7d22\u8cbb\u57ce](/img/blog/explore-philadelphia2.gif) | \\r\\n|:--:| \\r\\n| *\u67e5\u770b\u8cbb\u57ce Rittenhouse \u516c\u5712\u7684 [\\"Lion Crushing a Serpent\\"](https://www.associationforpublicart.org/artwork/lion-crushing-a-serpent/)* |\\r\\n\\r\\n## \u9019\u4e0d\u662f\u5730\u5716 \\r\\n\\r\\nExplore \u5de5\u5177\u770b\u8d77\u4f86\u53ef\u80fd\u50cf\u662f\u5730\u5716\uff0c\u4f46\u6211\u5011\u66f4\u9858\u610f\u5c07\u5176\u8996\u70ba\u4e00\u7a2e X \u5149\u8cc7\u6599\u6aa2\u67e5\u5668\u3002\u6211\u5011\u653e\u68c4\u4e86\u88fd\u4f5c\u88fd\u5716\u6c7a\u7b56\uff0c\u800c\u662f\u9078\u64c7\u4e00\u6b21\u6027\u986f\u793a Overture \u7684\u6240\u6709\u4e3b\u984c\uff1a\u5730\u5740\u3001\u57fa\u790e\u8cc7\u6599\u3001\u5efa\u7bc9\u3001\u5340\u57df\u3001\u5730\u9ede\u548c\u4ea4\u901a\u3002\u6211\u5011\u7684\u4f7f\u7528\u8005\u6709\u4e0d\u540c\u7684\u8996\u89d2\u548c\u76ee\u6a19\uff0c\u6211\u5011\u5e0c\u671b\u63d0\u4f9b\u76e1\u53ef\u80fd\u591a\u7684\u8a0a\u606f\u3002\u6211\u5011\u9084\u5e0c\u671b\u6fc0\u767c\u60a8\u7684\u597d\u5947\u5fc3\uff0c\u4e26\u6fc0\u52f5\u60a8\u5c0d Overture \u8cc7\u6599\u63d0\u51fa\u65b0\u7684\u554f\u984c\u3002\\r\\n\\r\\n\u4e00\u6b21\u6027\u770b\u5230\u6240\u6709\u8cc7\u6599\u53ef\u80fd\u6703\u8b93\u4eba\u611f\u5230\u6709\u4e9b\u4e0d\u77e5\u6240\u63aa\u3002\u6211\u5011\u5efa\u8b70\u653e\u5927\u5230\u60a8\u611f\u8208\u8da3\u7684\u5340\u57df\uff0c\u61f8\u505c\u5728\u5730\u5716\u5de6\u4e0a\u89d2\u7684\u5716\u5c64\u5716\u6a19\u4e0a\uff0c\u4e26\u5207\u63db\u8cc7\u6599\u4e3b\u984c\u7684\u986f\u793a\u8207\u96b1\u85cf\u3002\u60a8\u53ef\u4ee5\u9ede\u64ca\u500b\u5225\u5730\u5716\u529f\u80fd\uff0c\u4f8b\u5982\u8457\u540d\u7684 [\\"Lion Crushing a Serpent\\"](https://youtu.be/rTl2ewUc6bA?feature=shared) \u96d5\u50cf\uff0c\u4ee5\u6aa2\u67e5\u5176\u5c6c\u6027\u3002\u60f3\u8981\u4e0b\u8f09\u8cc7\u6599\u55ce\uff1f\u5728 Explore \u7db2\u7ad9\u7684\u53f3\u4e0a\u89d2\uff0c\u60a8\u53ef\u4ee5\u9ede\u64ca\u201c\u4e0b\u8f09\u53ef\u898b\u201d\u6309\u9215\uff0c\u4ee5\u751f\u6210\u5305\u542b\u700f\u89bd\u5668\u4e2d\u6240\u6709\u53ef\u898b\u8cc7\u6599\u7684 GeoJSON \u6a94\u6848\u3002\\r\\n\\r\\n\\r\\n[Explore \u7db2\u7ad9](https://explore.overturemaps.org/#13.01/39.95692/-75.15583) \u76ee\u524d\u8655\u65bc\u6e2c\u8a66\u968e\u6bb5\uff0c\u60a8\u7684\u53cd\u994b\u5c07\u5e6b\u52a9\u6211\u5011\u5728\u672a\u4f86\u5e7e\u500b\u6708\u5167\u6dfb\u52a0\u66f4\u591a\u529f\u80fd\u3002\u5982\u679c\u60a8\u5c0d\u8cc7\u6599\u6709\u4efb\u4f55\u7591\u554f\uff0c\u6216\u60f3\u5831\u544a\u8cc7\u6599\u8cea\u91cf\u554f\u984c\u6216\u7db2\u7ad9\u6545\u969c\uff0c\u8acb\u9ede\u64ca\u932f\u8aa4\u5716\u6a19\u4e26[\u5728 GitHub \u4e0a\u63d0\u4ea4\u554f\u984c](https://github.com/OvertureMaps/io-site/issues)\u3002\uff08\u6ce8\u610f\uff1a\u6211\u5011\u6b63\u5728\u7a4d\u6975\u89e3\u6c7a\u5df2\u77e5\u7684\u4e0b\u8f09\u8cc7\u6599\u554f\u984c\u3002\uff09\\r\\n\\r\\n## \u8207\u6211\u5011\u4e00\u8d77\u958b\u767c\\r\\n\\r\\n\u8a72\u9805\u76ee\u6e90\u81ea\u53c3\u8207 Overture \u958b\u767c\u7684\u5de5\u7a0b\u5e2b\u5011\u8c50\u5bcc\u7684\u7d93\u9a57\u548c\u6280\u80fd\u3002\u6211\u5011\u4f7f\u7528 [WebAssembly](https://webassembly.org/) \u548c Rust\uff0c\u7279\u5225\u662f\u4f7f\u7528 [geoarrow-rs](https://geoarrow.org/geoarrow-rs/) \u67e5\u8a62\u548c\u4e0b\u8f09 [Overture \u7684 GeoParquet \u6a94\u6848](https://docs.overturemaps.org/getting-data/)\u3002\u524d\u7aef\u4f7f\u7528 React \u548c [Maplibre](https://maplibre.org/)\uff0c\u6211\u5011\u7522\u751f [PMTiles](https://docs.protomaps.com/pmtiles/) \u4f86\u8996\u89ba\u5316\u8cc7\u6599\u3002\u9019\u662f\u4e00\u500b\u7121\u4f3a\u670d\u5668\u7db2\u7ad9\uff0c\u4f7f\u7528 cloud-native  \u5b58\u5132\u683c\u5f0f\u3002\u6211\u5011\u9084\u8a08\u5283\u5728\u6bcf\u6b21 Overture \u767c\u4f48\u6642\u63d0\u4f9b [PMTiles](https://github.com/OvertureMaps/overture-tiles)\u3002\u7279\u5225\u611f\u8b1d\u4f86\u81ea [Development Seed](https://developmentseed.org/) \u7684 Kyle Barron \u548c\u4f86\u81ea [Protomaps](https://protomaps.com/) \u7684 Brandon Liu\uff0c\u8207 Overture \u7684\u958b\u767c\u8005\u5ba3\u50b3\u5718\u968a\u5408\u4f5c\u958b\u59cb\u4e86\u9019\u500b\u9805\u76ee\u3002\\r\\n\\r\\n[Explore \u662f\u958b\u6e90\u7684](https://github.com/OvertureMaps/io-site)\uff0c\u57fa\u65bc MIT \u8a31\u53ef\uff0c\u6211\u5011\u6b61\u8fce Overture \u793e\u5340\u7684\u8ca2\u737b\u3002\u6211\u5011\u7684\u76ee\u6a19\u662f\u70ba\u60a8\u63d0\u4f9b\u69cb\u5efa\u570d\u7e5e Overture \u8cc7\u6599\u7684\u5de5\u5177\u7684\u57fa\u672c\u69cb\u5efa\u6a21\u7d44\u3002\u544a\u8a34\u6211\u5011\u60a8\u7684\u5275\u4f5c\uff0c\u6211\u5011\u5c07\u6a02\u65bc\u5728\u6211\u5011\u7684[\u793e\u5340\u9805\u76ee\u9801\u9762](https://docs.overturemaps.org/community/)\u4e0a\u5206\u4eab\u3002"},{"id":"/2024/05/16/land-cover","metadata":{"permalink":"/zh-Hant/blog/2024/05/16/land-cover","source":"@site/i18n/zh-Hant/docusaurus-plugin-content-blog/2024-05-16-land-cover.mdx","title":"\u571f\u5730\u690d\u88ab\u72c0\u6cc1\u5373\u6642\u66f4\u65b0","description":"land cover gif","date":"2024-05-16T00:00:00.000Z","tags":[],"readingTime":3.105,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"\u571f\u5730\u690d\u88ab\u72c0\u6cc1\u5373\u6642\u66f4\u65b0"},"unlisted":false,"prevItem":{"title":"\u4e0d\u9700\u8981 SQL \u5c31\u53ef\u4ee5\u63a2\u7d22 Overture \u8cc7\u6599","permalink":"/zh-Hant/blog/2024/07/24/explore-site"},"nextItem":{"title":"\u63a2\u7d22\u6211\u5011\u7684\u516c\u958b\u6e2c\u8a66\u7248","permalink":"/zh-Hant/blog/2024/04/22/beta-release"}},"content":"![land cover gif](/img/blog/lc.gif)\\r\\n\\r\\n## \u88fd\u5716\u5e2b\u5011\u7684\u798f\u97f3\uff01\\r\\n\\r\\n[Overture Maps \u7684 5 \u6708\u767c\u4f48](https://docs.overturemaps.org/release/latest) \u5305\u62ec\u4e86\u65b0\u7684\u9ad8\u89e3\u6790\u5ea6\u571f\u5730\u690d\u88ab\u8cc7\u6599*\u4ee5\u53ca*\u65b0\u7684\u88fd\u5716\u67b6\u69cb\u5c6c\u6027\u3002\\r\\n\\r\\n\u6211\u5011\u7684 `land_cover` \u5716\u5c64\u662f\u5f9e[\u6b50\u6d32\u592a\u7a7a\u7e3d\u7f72 2020 \u5e74 WorldCover (10m) \u5149\u67f5\u8cc7\u6599](https://esa-worldcover.org/en)\u884d\u751f\u7684\u5411\u91cf\u8cc7\u6599\u3002\u5b83\u985e\u4f3c\u65bc [Daylight](https://daylightmap.org/2023/10/11/landcover.html) \u5730\u5716\u5206\u767c\u4e2d\u7684\u571f\u5730\u690d\u88ab\u5c64\uff0c\u4f46 Overture Maps \u6dfb\u52a0\u4e86\u66f4\u9ad8\u89e3\u6790\u5ea6\u7684\u8cc7\u6599\uff08\u7e2e\u653e\u7d1a\u5225 15\uff09\uff0c\u63d0\u4f9b\u4e86\u66f4\u591a\u7d30\u7bc0\u548c\u571f\u5730\u690d\u88ab\u985e\u5225\u3002\u65b0\u7684\u8cc7\u6599\u4e2d\u5305\u542b 10 \u7a2e\u5b50\u985e\u578b\uff1a\u96ea\u5730\u3001\u68ee\u6797\u3001\u57ce\u5e02\u3001\u8349\u5730\u3001\u8fb2\u4f5c\u7269\u3001\u8352\u6f20\u3001\u6fd5\u5730\u3001\u82d4\u861a\u3001\u7d05\u6a39\u6797\u548c\u704c\u6728\u3002\\r\\n\\r\\n\u6211\u5011\u7684 5 \u6708\u767c\u4f48\u9084\u5305\u62ec\u4e86[\u67b6\u69cb\u5c6c\u6027](https://docs.overturemaps.org/schema/reference/base/land_cover/)\uff0c\u70ba\u88fd\u5716\u6642\u6700\u4f73\u4f7f\u7528 Overture Maps \u8cc7\u6599\u63d0\u4f9b\u88fd\u5716\u201c\u63d0\u793a\u201d\u3002\u6211\u5011\u6dfb\u52a0\u4e86 `min_zoom` \u548c `max_zoom`\uff0c\u4ee5\u4f7f\u7528\u5e38\u898b\u7684\u201c\u6ed1\u52d5\u5730\u5716\u201d\u7e2e\u653e\u7d1a\u5225\u898f\u7bc4\u4f86\u5b9a\u7fa9\u6bcf\u500b\u89e3\u6790\u5ea6\u571f\u5730\u690d\u88ab\u7684\u63a8\u85a6\u7e2e\u653e\u7d1a\u5225\u3002\u9019\u662f\u6539\u5584\u88fd\u5716\u5e2b\u4f7f\u7528\u8005\u9ad4\u9a57\u7684\u7b2c\u4e00\u6b65\uff0c\u6211\u5011\u8a08\u5283\u5728\u672a\u4f86\u7684 Overture Maps \u8cc7\u6599\u767c\u4f48\u4e2d\u64f4\u5c55\u9019\u4e9b\u5c6c\u6027\u3002\\r\\n\\r\\n## \u63a2\u7d22\u571f\u5730\u690d\u88ab\\r\\n\\r\\n\u5728\u4e0b\u9762\u7684\u7bc4\u4f8b\u4e2d\uff0c\u5c07\u5c55\u793a\u5982\u4f55\u4f7f\u7528 [lonboard](https://developmentseed.org/lonboard/latest/) \u548c [Overture Maps Python Command-line Tool](https://github.com/OvertureMaps/overturemaps-py) \u63d0\u53d6\u3001\u8655\u7406\u548c\u8996\u89ba\u5316\u611f\u8208\u8da3\u5340\u57df\u7684\u571f\u5730\u690d\u88ab\u8cc7\u6599\u3002\u6211\u5011\u5efa\u8b70\u60a8\u67e5\u95b1 lonboard \u6587\u6a94\u4e2d\u7684[\u9019\u500b\u7bc4\u4f8b](https://developmentseed.org/lonboard/latest/examples/overture-maps/)\uff0c\u4ee5\u66f4\u597d\u5730\u7406\u89e3\u6b64\u8655\u4f7f\u7528\u7684\u65b9\u6cd5\u3002\u60a8\u53ef\u4ee5\u5728 [Notebook Sharing Space](https://notebooksharing.space/view/b63f6b3dda1da99c45caf53284fbc508aaae0a43480b43bb0316db636c5e6677) \u67e5\u770b\u548c\u4e0b\u8f09\u5b8c\u6574\u7684 Jupyter Notebook\u3002\\r\\n\\r\\n![land cover](/img/blog/notebook-overture-lc.png)\\r\\n\\r\\n\u8981\u8ddf\u96a8\u9019\u4e9b\u6b65\u9a5f\uff0c\u60a8\u9700\u8981\u57f7\u884c [JupyterLab \u6216 Jupyter Notebook](https://jupyter.org/) \u4e26\u5b89\u88dd\u4ee5\u4e0b\u5fc5\u8981\u5957\u4ef6\uff1a\\r\\n- [lonboard](https://developmentseed.org/lonboard/latest/#install)\\r\\n- [overturemaps-py](https://github.com/OvertureMaps/overturemaps-py)\\r\\n- [pandas](https://pandas.pydata.org/)\\r\\n- [GeoPandas](https://geopandas.org/en/stable/index.html)\\r\\n- [Shapely](https://shapely.readthedocs.io/en/stable/index.html) \\r\\n\\r\\n\\r\\n\\r\\n``` python\\r\\nimport pandas as pd\\r\\nimport geopandas as gpd\\r\\nimport overturemaps \\r\\nfrom shapely import wkb\\r\\nfrom lonboard import Map, PolygonLayer\\r\\nfrom lonboard.colormap import apply_categorical_cmap\\r\\n```\\r\\n\\r\\n``` python\\r\\n# specify bounding box\\r\\nbbox =  -78.6429, 39.463, -73.7806, 41.6242\\r\\n```\\r\\n\\r\\n``` python\\r\\n# read in Overture Maps land_cover data type\\r\\ntable = overturemaps.record_batch_reader(\\"land_cover\\", bbox).read_all()\\r\\ntable = table.combine_chunks()\\r\\n```\\r\\n\\r\\n``` python\\r\\n# convert to dataframe\\r\\ndf = table.to_pandas()\\r\\n```\\r\\n\\r\\n``` python\\r\\n# filter for higher resolution land_cover features\\r\\ndf_h = df[df.cartography.apply(lambda x: x[\'min_zoom\'] == 8)]\\r\\n```\\r\\n\\r\\n``` python\\r\\n# create color map for land_cover subtypes, loosely based on natural-color palette: https://www.shadedrelief.com/shelton/c.html\\r\\ncolor_map = {\\r\\n    \\"urban\\": [167, 162, 186],\\r\\n    \\"forest\\": [134, 178, 137],\\r\\n    \\"barren\\": [245, 237, 213],\\r\\n    \\"shrub\\": [239, 218, 182],\\r\\n    \\"grass\\": [254, 239, 173],\\r\\n    \\"crop\\": [222, 223, 154],\\r\\n    \\"wetland\\": [158, 207, 195], \\r\\n    \\"mangrove\\": [83, 171, 128],\\r\\n    \\"moss\\": [250, 230, 160],\\r\\n    \\"snow\\": [255, 255, 255],  \\r\\n}\\r\\n```\\r\\n\\r\\n``` python\\r\\n# apply color map to land_cover subtypes\\r\\ncolors = apply_categorical_cmap(df_h.subtype, color_map)\\r\\n```\\r\\n\\r\\n``` python\\r\\n# dataframe to geodataframe, set crs\\r\\ngdf = gpd.GeoDataFrame(\\r\\n    df_h, \\r\\n    geometry=df_h[\'geometry\'].apply(wkb.loads), \\r\\n    crs=\\"EPSG:4326\\"\\r\\n)\\r\\n```\\r\\n\\r\\n``` python\\r\\n# create map layer \\r\\nlayer = PolygonLayer.from_geopandas(\\r\\n    gdf= gdf[[\'id\',\'subtype\', \'cartography\', \'geometry\']].reset_index(drop=True),\\r\\n    get_fill_color=colors,\\r\\n    get_line_color=colors,\\r\\n)\\r\\n```\\r\\n\\r\\n``` python\\r\\n#render map\\r\\nview_state = {\\r\\n    \\"longitude\\": -76.2,\\r\\n    \\"latitude\\": 39.6,\\r\\n    \\"zoom\\": 8,\\r\\n    \\"pitch\\": 65,\\r\\n    \\"bearing\\": 5,\\r\\n}\\r\\nm = Map(layer, view_state=view_state)\\r\\nm\\r\\n```"},{"id":"/2024/04/22/beta-release","metadata":{"permalink":"/zh-Hant/blog/2024/04/22/beta-release","source":"@site/i18n/zh-Hant/docusaurus-plugin-content-blog/2024-04-22-beta-release.mdx","title":"\u63a2\u7d22\u6211\u5011\u7684\u516c\u958b\u6e2c\u8a66\u7248","description":"Highlights from Overture Maps beta release","date":"2024-04-22T00:00:00.000Z","tags":[],"readingTime":4.36,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"\u63a2\u7d22\u6211\u5011\u7684\u516c\u958b\u6e2c\u8a66\u7248","description":"Highlights from Overture Maps beta release"},"unlisted":false,"prevItem":{"title":"\u571f\u5730\u690d\u88ab\u72c0\u6cc1\u5373\u6642\u66f4\u65b0","permalink":"/zh-Hant/blog/2024/05/16/land-cover"},"nextItem":{"title":"\u6b61\u8fce\uff01","permalink":"/zh-Hant/blog/2024/04/21/welcome"}},"content":"import Tabs from \'@theme/Tabs\';\\r\\nimport TabItem from \'@theme/TabItem\';\\r\\n\\r\\n\u4e0a\u9031\uff0cOverture Maps [\u5ba3\u5e03\u4e86\u6211\u5011\u7684\u6a21\u5f0f\u548c\u8cc7\u6599\u7684\u6e2c\u8a66\u7248\u91cb\u51fa](https://overturemaps.org/overture-maps-foundation-releases-beta-of-its-first-open-map-dataset/)\u3002\u7d93\u904e\u6578\u6708\u7684\u52aa\u529b\u548c\u7a69\u5b9a\u6539\u9032\uff0c\u6211\u5011\u5373\u5c07\u9054\u5230\u751f\u7522\u7d1a\u7a69\u5b9a\u6027\u3002\u5728\u63a5\u4e0b\u4f86\u7684\u5e7e\u9031\u5167\uff0c\u6211\u5011\u5c07\u767c\u4f48\u4e00\u7cfb\u5217\u6587\u7ae0\u2014\u2014\u5f9e\u9019\u7bc7\u958b\u59cb\u2014\u2014\u6df1\u5165\u4ecb\u7d39\u6b64\u6b21\u91cb\u51fa\u4e2d\u7684\u4eae\u9ede\u548c\u6539\u9032\u3002\\r\\n\\r\\n## \u52a0\u5feb\u5730\u7406\u7a7a\u9593\u8655\u7406\\r\\n\u4f60\u6703\u9996\u5148\u6ce8\u610f\u5230\uff0c\u6211\u5011 [\u5f9e\u96f2\u7aef\u63d0\u53d6 Overture Maps \u8cc7\u6599\u7684\u901f\u5ea6\u8b8a\u5f97\u66f4\u5feb](https://docs.overturemaps.org/getting-data/locally/)\u3002\u6211\u5011\u901a\u904e\u8207\u958b\u6e90\u5354\u4f5c\u8005\u5bc6\u5207\u5408\u4f5c\uff0c\u5c0d\u6211\u5011\u7684 GeoParquet \u6a94\u6848\u9032\u884c\u4e86\u518d\u5206\u5340\u548c [\u7a7a\u9593\u512a\u5316](https://cloudnativegeo.org/blog/2024/03/coming-soon-geoparquet-1.1/)\u3002\u540c\u6642\uff0c\u6211\u5011\u7684\u670b\u53cb DuckDB\uff0c\u9019\u662f\u6211\u5011\u6700\u559c\u611b\u7684 SQL \u5de5\u5177\u4e4b\u4e00\uff0c[\u65b0\u589e\u4e86\u4e00\u500b\u529f\u80fd](https://github.com/duckdb/duckdb/pull/10314)\uff0c\u63d0\u5347\u4e86\u5e36 bounding box \u67e5\u8a62\u7684\u6548\u80fd\u3002\\r\\n\\r\\n<details>\\r\\n\\r\\n<summary>Query speeds have improved significantly from our February release to the April beta release. This example compares DuckDB queries for buildings in Philadelphia. [See here for more information about our performance testing](https://github.com/opengeospatial/geoparquet/discussions/188#discussioncomment-8909348).</summary>\\r\\n\\r\\n    <Tabs>\\r\\n        <TabItem value=\\"february\\" label=\\"2024-02-15-alpha.0 release\\" default>\\r\\n            ```\\r\\n            SELECT \\r\\n            *\\r\\n            FROM \\r\\n                read_parquet(\'s3://overturemaps-us-west-2/release/2024-02-15-alpha.0/theme=buildings/type=building/*\', filename=true, hive_partitioning=1)\\r\\n            WHERE \\r\\n                bbox.minx > -75.60154\\r\\n                AND bbox.maxx < -74.955763\\r\\n                AND bbox.miny > 39.867004\\r\\n                AND bbox.maxy < 40.137992;\\r\\n            ```\\r\\n            820,915 buildings   \\r\\n            ~120s\\r\\n        </TabItem>\\r\\n\\r\\n    \\r\\n        <TabItem value=\\"april\\" label=\\"2024-04-16-beta.0 release\\" default>\\r\\n            ```\\r\\n            SELECT \\r\\n            *\\r\\n            FROM   \\r\\n                read_parquet(\'s3://overturemaps-us-west-2/release/2024-04-16-beta.0/theme=buildings/type=building/*\', filename=true, hive_partitioning=1)\\r\\n            WHERE \\r\\n                bbox.xmin > -75.60154\\r\\n                AND bbox.xmax < -74.955763\\r\\n                AND bbox.ymin > 39.867004\\r\\n                AND bbox.ymax < 40.137992\\r\\n            ```\\r\\n            852,487 buildings    \\r\\n            ~25s\\r\\n        </TabItem>\\r\\n    </Tabs>\\r\\n</details>\\r\\n\\r\\n\u6211\u5011\u6b63\u5728\u8207 Development Seed \u7684\u6210\u54e1\u4e00\u8d77\u7e7c\u7e8c\u70ba\u4f7f\u7528\u8005\u63d0\u4f9b\u66f4\u5feb\u66f4\u7c21\u4fbf\u7684\u9ad4\u9a57\uff0cDevelopment Seed\u4e5f\u662f [Overture Maps Foundation \u7684\u6210\u54e1](https://overturemaps.org/about/members/)\uff0c\u6211\u5011\u6b63\u5728 [\u57fa\u65bc lonboard](https://developmentseed.org/lonboard/latest/examples/overture-maps/) \u958b\u767c\u91dd\u5c0d Overture Maps \u8cc7\u6599\u7684\u7279\u6b8a\u5de5\u5177\uff0c\u9019\u662f\u4ed6\u5011\u7528\u65bc\u5728 Jupyter \u4e2d\u8996\u89ba\u5316\u5927\u578b\u5730\u7406\u7a7a\u9593\u8cc7\u6599\u96c6\u7684 Python \u542b\u5f0f\u5eab\u3002\u6700\u8fd1\uff0c\u6211\u5011\u7684\u670b\u53cb Wherobots [\u5168\u9762\u4e86\u89e3\u4e86](https://wherobots.com/overture-maps-data-cloud-native-geoparquet-apache-sedona/) \u6211\u5011\u5982\u4f55\u4f7f\u7528 GeoParquet \u4f7f\u5f97 Apache Sedona \u67e5\u8a62\u548c\u5206\u6790\u8cc7\u6599\u8b8a\u5f97\u975e\u5e38\u9ad8\u6548\u3002\\r\\n\\r\\n\u6b63\u5982\u4f60\u6240\u898b\uff0c\u6211\u5011\u6b63\u5728\u8207\u793e\u7fa4\u4e00\u8d77\u63a8\u9032\uff0c\u5c0d\u8cc7\u6599\u3001\u8edf\u9ad4\u548c\u898f\u7bc4\u9032\u884c\u8fed\u4ee3\uff0c\u4e26\u4ee5\u63d0\u5347\u5730\u7406\u7a7a\u9593 **_\u901f\u5ea6_** \u70ba\u5171\u540c\u76ee\u6a19\u3002\\r\\n\\r\\n## \u66f4\u6613\u7528\u7684\u6a21\u5f0f\\r\\n\u6e2c\u8a66\u7248\u91cb\u51fa\u7684\u53e6\u4e00\u500b\u4eae\u9ede\u662f\u8f49\u5411\u66f4\u6613\u7528\u7684\u884c\u653f\u908a\u754c\u8cc7\u6599\u6a21\u5f0f\u3002\u6211\u5011\u5728\u4e8c\u6708\u4efd\u9996\u5148 [\u8207 Overture Maps \u793e\u7fa4\u63a2\u8a0e\u4e86\u9019\u500b\u60f3\u6cd5](https://github.com/OvertureMaps/schema/discussions/117)\uff0c\u7d93\u904e\u77ed\u77ed\u5169\u500b\u6708\u7684\u5de5\u4f5c\uff0c [\u65b0\u7684\u5206\u5340\u6a21\u5f0f\u548c\u8cc7\u6599](https://docs.overturemaps.org/guides/divisions/) \u73fe\u5df2\u6e96\u5099\u5c31\u7dd2\u3002\u4ee5\u4e0b\u662f\u67e5\u8a62 `divisions` \u7684\u4e00\u500b\u4f8b\u5b50\uff0c\u8a72\u67e5\u8a62\u6293\u53d6\u4e86\u5168\u7403\u6240\u6709\u570b\u5bb6\u7684\u5e7e\u4f55\u8a0a\u606f\uff1a\\r\\n\\r\\n```\\r\\nSELECT *\\r\\n   FROM read_parquet(\'s3://overturemaps-us-west-2/release/2024-04-16-beta.0/theme=divisions/type=division_area/*\', filename=true, hive_partitioning=1)\\r\\nWHERE subtype = \'country\';\\r\\n```\\r\\n \\r\\n\u60a8\u53ef\u4ee5\u6ce8\u610f\u5230 `divisions` \u67e5\u8a62\u6bd4\u5c0d `admins` \u7684\u76f8\u61c9\u67e5\u8a62\u8981\u7c21\u55ae\u5f97\u591a\uff1a\\r\\n\\r\\n\\r\\n```\\r\\nWITH admins AS (\\r\\n    SELECT *\\r\\n    FROM read_parquet(\'s3://overturemaps-us-west-2/release/2024-04-16-beta.0/theme=admins/type=*/*\', filename=true, hive_partitioning=1)\\r\\n  )\\r\\n\\r\\n  SELECT *\\r\\n    FROM admins country_locality\\r\\n    JOIN admins country_area\\r\\n      ON country_area.locality_id = country_locality.id\\r\\n   WHERE country_locality.locality_type = \'country\';\\r\\n\\r\\n```    \\r\\n\\r\\n\u6211\u5011\u8a08\u5283\u5728\u4e03\u6708\u7684\u7248\u672c\u4e2d [\u68c4\u7528 admins](https://docs.overturemaps.org/release-notes/)\u3002\u5728\u6b64\u671f\u9593\uff0c`admins` \u548c `divisions` \u5c07\u540c\u6642\u63d0\u4f9b\u7d66\u4f7f\u7528\u8005\u4f7f\u7528\u3002\\r\\n\\r\\n## \u6a4b\u6a11\u3001\u5cf6\u5dbc\u3001\u7011\u5e03\u7b49\u7b49\uff01\\r\\n\u5728\u6b64\u6b21\u91cb\u51fa\u4e2d\uff0c\u6211\u5011\u5728 `base` \u5c64\u4e2d\u589e\u52a0\u4e86\u66f4\u591a\u8c50\u5bcc\u7684\u7d30\u7bc0\uff0c\u5305\u62ec\u4f86\u81ea [Facebook Daylight \u5730\u5716\u5206\u767c](https://daylightmap.org/) \u7684\u719f\u6089\u7279\u5fb5\u7684 `infrastructure` \u985e\u578b\u3002\u6211\u5011\u9084\u70ba `land`\u3001`land_use` \u548c `water` \u7279\u5fb5\u985e\u578b\u65b0\u589e\u4e86\u5b50\u985e\u578b\u548c\u985e\u5225\u3002\u4f60\u53ef\u4ee5\u5728\u6211\u5011\u7684 [\u6a21\u5f0f\u53c3\u8003\u6587\u6a94](https://docs.overturemaps.org/schema/reference/base/infrastructure) \u4e2d\u627e\u5230\u6bcf\u500b\u7279\u5fb5\u985e\u578b\u7684\u5b50\u985e\u578b\u548c\u985e\u5225\u7684\u8a73\u7d30\u5217\u8868\u3002\u6e96\u5099\u597d\u88fd\u4f5c\u81ea\u5df1\u7684\u5730\u5716\u4e86\u55ce\uff1f\u6211\u5011\u6709\u4e00\u500b [\u6559\u5b78\u5e6b\u52a9\u4f60\u5165\u9580](https://docs.overturemaps.org/examples/build-a-map/#13/47.6/-122.33/0/45)\u3002\\r\\n\\r\\n## \u8acb\u7e7c\u7e8c\u95dc\u6ce8\u66f4\u591a\u7126\u9ede\\r\\n\u6211\u5011\u4e0d\u4e45\u5f8c\u5c31\u6703\u518d\u767c\u4f48\u66f4\u591a\u5f9e\u6e2c\u8a66\u7248\u91cb\u51fa\u5230\u751f\u7522\u904e\u7a0b\u4e2d\u7684\u6587\u7ae0\u3002\u5728\u9019\u6bb5\u6642\u9593\uff0c\u6211\u5011\u9080\u8acb\u4f60 [\u958b\u59cb\u4f7f\u7528\u6211\u5011\u7684\u8cc7\u6599](https://docs.overturemaps.org/getting-data/) \u4e26\u8207\u6211\u5011\u5206\u4eab\u4f60\u7684 [\u8a55\u8ad6\u548c\u610f\u898b](https://github.com/OvertureMaps/data/discussions)\u3002"},{"id":"/2024/04/21/welcome","metadata":{"permalink":"/zh-Hant/blog/2024/04/21/welcome","source":"@site/i18n/zh-Hant/docusaurus-plugin-content-blog/2024-04-21-welcome.mdx","title":"\u6b61\u8fce\uff01","description":"\u6b61\u8fce\u4f86\u5230 Overture Maps \u5de5\u7a0b\u90e8\u843d\u683c\uff01","date":"2024-04-21T00:00:00.000Z","tags":[],"readingTime":0.76,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"\u6b61\u8fce\uff01"},"unlisted":false,"prevItem":{"title":"\u63a2\u7d22\u6211\u5011\u7684\u516c\u958b\u6e2c\u8a66\u7248","permalink":"/zh-Hant/blog/2024/04/22/beta-release"}},"content":"\u6b61\u8fce\u4f86\u5230 Overture Maps \u5de5\u7a0b\u90e8\u843d\u683c\uff01\\r\\n\x3c!-- truncate --\x3e\\r\\n \\r\\n\u6211\u5011\u5f88\u9ad8\u8208\u8207\u60a8\u5206\u4eab\u9019\u500b\u5de8\u5927\u3001\u6fc0\u52d5\u4eba\u5fc3\u3001\u5145\u6eff\u5408\u4f5c\u7cbe\u795e\u7684\u9805\u76ee\u80cc\u5f8c\u7684\u6280\u8853\u6545\u4e8b\u3002\u9019\u662f\u6211\u5011 [\u4e00\u5e74\u591a\u4f86\u4e00\u76f4\u5728\u52aa\u529b\u7684\u9805\u76ee](https://overturemaps.org/looking-forward-to-2024/)\u3002\u81f4\u529b\u65bc\u69cb\u5efa Overture Maps \u7684\u5de5\u7a0b\u5e2b\u5011\u6e34\u671b\u8207\u6211\u5011\u7684\u958b\u767c\u8005\u793e\u5340\u5efa\u7acb\u806f\u7e6b\u3002\u5728\u63a5\u4e0b\u4f86\u5e7e\u500b\u6708\u4e2d\u767c\u8868\u7684\u6587\u7ae0\u4e2d\uff0c\u60a8\u5c07\u807d\u5230\u4f86\u81eaAmazon\u3001Meta\u3001Microsoft\u3001TomTom\u3001Esri\u3001Development Seed\u3001Precisely \u7b49\u516c\u53f8\u7684\u5718\u968a\u6210\u54e1\u7684\u8072\u97f3\u3002\u6211\u5011\u4e5f\u5e0c\u671b\u807d\u5230\u60a8\u7684\u610f\u898b\uff1a\u60a8\u7684 [\u56de\u994b\u548c\u958b\u6e90\u8ca2\u737b](https://github.com/OvertureMaps/data/discussions) \u662f\u6211\u5011\u6210\u529f\u7684\u95dc\u9375\u3002"}]}}')}}]);